Well we had all 4 seasons of weather during my trip to the @bass_nation Kayak Championship on Lake Chickamauga in Tennessee. Didn’t have much expectations going into this event as I have never been to the lake, but I stuck to what I know and found some grass to find a few fish. Great experience to get up on stage at the Classic! Thanks to @bass_nation for the opportunity and Steve Owens for running a great tournament. Congrats to @russnyders on the win! 
